/**
 * 上链效果
 */

;(function(win, $){
    var beginGif = 'data:image/gif;base64,',
        doingGif = 'data:image/gif;base64,',
        successGif = 'data:image/gif;base64,',
        failGif = 'data:image/gif;base64,';

    var $cover = $('<div class="chain-cover hidden"></div>'),
        $loadingContent,
        style = '.chain-cover{position:absolute;left:0;right:0;top:0;bottom:0;background:tansparent;background:rgba(0,0,0,0.3);}.chain-loading{position:absolute;width:350px;height:300px;background:url(' + beginGif + ');top:50%;left:50%;margin-top:-150px;margin-left:-175px;}.chain-loading.doing{background:url(' + doingGif + ');}.chain-loading.fail{background:url(' + failGif + ');}.chain-loading.success{background:url(' + successGif + ');}',
        $style = $('<style>' + style + '</style>'),
        isInit = false;
        
    function beginLoading() {
        if(!isInit) {
            $style.appendTo('head');
            $cover.appendTo('body');
        }
        
        $loadingContent = $('<div class="chain-loading"></div>').appendTo($cover);
        setTimeout(function () {
            $loadingContent.addClass('doing');
        }, 3000);
    }

    function hideLoading(time) {
        setTimeout(function () {
            $cover.addClass('hidden');
            $loadingContent.remove();
        }, time || 3000);
    }
    win.chainLoading = {
        show: function() {
            $cover.removeClass('hidden');
            beginLoading();
        },
        success: function() {
            $loadingContent.removeClass('doing').addClass('success');
            hideLoading(4000);
        },
        fail: function() {
            $loadingContent.removeClass('doing').addClass('fail');
            hideLoading();
        }
        
    };
    
})(this, jQuery);
